import React from "react";
import Grid from "@material-ui/core/Grid";

const MainContainer = () => {
  return (
    <Grid container>
      <Grid item sm={12} md={6}>
        This is First
      </Grid>
      <Grid item sm={12} md={6}>
        This is Second
      </Grid>
    </Grid>
  );
};

export default MainContainer;
